import React from "react";

const ImageLinkForm = () => {
	return (
		<div>
			<p className="f3">
				{"Smart Brain will detect faces in your photos. Give it a try!"}
			</p>
			<div>
				<input className="f4 pa2 w-50 center" type="text" />
			</div>
			<div>
				<button className="mt1 w-30 grow f4 link ph3 pv2 dib white bg-light-purple">
					Detect
				</button>
			</div>
		</div>
	);
};

export default ImageLinkForm;
